import './App.css';
import { Box } from '@mui/material';

import Navbar from './components/navbar';

/////////////////////
import About from './pages/about';
import Contact from './pages/contact';
import Education from './pages/education';
import Experience from './pages/experience';
import Project from './pages/projects';
import Skills from './pages/skills';

function App() {
  return (
    <Box 
      sx={{ 
          background: 'linear-gradient(100deg, hsl(232, 36.00%, 49.00%), rgb(159, 78, 197))',
        minHeight: '100vh',  // tüm ekran yüksekliği kadar
      }}
    >
      <Navbar />

      <Box id="about"> <About /> </Box>
      <Box id="contact"> <Contact /> </Box>
      <Box id="education"> <Education /> </Box>
      <Box id="experience"> <Experience /> </Box>
      <Box id="projects"> <Project /> </Box>
      <Box id="skills"> <Skills /> </Box>



    </Box>
  );
}

export default App;
